const arr = ['Apple', 'banana', 'Cherry', 'avocado'];

arr.sort((a, b) => {
  if (a.toLowerCase() < b.toLowerCase()) return -1;
  if (a.toLowerCase() > b.toLowerCase()) return 1;
  return a.localeCompare(b);
});

console.log(arr);
// Output: ["Apple", "avocado", "banana", "Cherry"]
```

In this example, the comparison function first converts both strings to lowercase and compares them. If they are equal, it uses the `localeCompare()` method to perform a case-sensitive comparison. This ensures that uppercase letters are sorted before lowercase letters.

