import UIKit

class StackedDrawables: UIView {
    private var iconScale: CGFloat = 0.70
    private var shouldPlaceIcons = true
    private var deviceTypes: [DeviceType] = []

    init(deviceTypes: [DeviceType], iconScale: CGFloat = 0.70) {
        self.deviceTypes = deviceTypes
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        guard let firstTwo = deviceTypes.prefix(2).map({ $0.iconOutlinedImageResource }).dropLastWhile({ $0 == nil }).map({ UIImage(named: $0 ?? "") }), firstTwo.count >= 2 else { return }

        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, image) in firstTwo.enumerated() {
            let imageView = UIImageView(image: image)
            imageView.frame.size = CGSize(width: iconsSize, height: iconsSize)
            imageView.center = CGPoint(x: bounds.midX, y: bounds.midY)
            switch index {
            case 1:
                imageView.frame.origin = CGPoint(x: 0, y: iconsInset)
            case 0:
                imageView.frame.origin = CGPoint(x: iconsInset, y: 0)
            default:
                break
            }
            addSubview(imageView)
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        if shouldPlaceIcons {
            setupLayers()
            shouldPlaceIcons = false
        } else {
            shouldPlaceIcons = true
        }
    }
}
